			shellScript = "#!/bin/bash\nset -euo pipefail\n\n# --- Ensure cargo is available on PATH -------------------------------------\nif [ -d \"$HOME/.cargo/bin\" ]; then\n  export PATH=\"$HOME/.cargo/bin:$PATH\"\nfi\n\n# --- Configuration ---------------------------------------------------------\nRUST_CRATE_DIR=\"$SRCROOT/../../../crates/nesium-flutter\"\nFRAMEWORKS_DIR=\"$SRCROOT/Frameworks\"\nOUTPUT_LIB_NAME=\"libnesium_flutter.a\"\n\n# --- Sanity checks ---------------------------------------------------------\nif [ ! -d \"$RUST_CRATE_DIR\" ]; then\n  echo \"[Rust] ERROR: Crate directory not found: $RUST_CRATE_DIR\" >&2\n  exit 1\nfi\n\nif ! command -v cargo >/dev/null 2>&1; then\n  echo \"[Rust] ERROR: 'cargo' not found in PATH. Please install Rust toolchain or update PATH.\" >&2\n  echo \"[Rust] Current PATH: $PATH\" >&2\n  exit 1\nfi\n\n# --- Determine build mode --------------------------------------------------\n# Requirement:\n#   - CONFIGURATION=Release        -> use custom profile: release-dist\n#   - CONFIGURATION!=Release       -> use standard release (even Debug/Profile/etc)\nCARGO_ARGS=()\nPROFILE_DIR=\"\"\nBUILD_LABEL=\"\"\n\nif [ \"${CONFIGURATION:-}\" = \"Release\" ]; then\n  CARGO_ARGS+=(--profile release-dist)\n  PROFILE_DIR=\"release-dist\"\n  BUILD_LABEL=\"release-dist\"\nelse\n  CARGO_ARGS+=(--release)\n  PROFILE_DIR=\"release\"\n  BUILD_LABEL=\"release\"\nfi\n\n# --- Target selection ------------------------------------------------------\nPLATFORM=\"${PLATFORM_NAME:-}\"\nARCHS_LIST=(${ARCHS:-})\nif [ ${#ARCHS_LIST[@]} -eq 0 ]; then\n  ARCHS_LIST=(\"arm64\")\nfi\n\nHAS_IOS_SIM_ARM64=0\nif rustc --print=target-list | grep -q \"^aarch64-apple-ios-sim$\"; then\n  HAS_IOS_SIM_ARM64=1\nfi\n\nTARGETS=()\nfor ARCH in \"${ARCHS_LIST[@]}\"; do\n  case \"${PLATFORM}:${ARCH}\" in\n    iphoneos:arm64)\n      TARGETS+=(\"aarch64-apple-ios\")\n      ;;\n    iphonesimulator:arm64)\n      if [ \"$HAS_IOS_SIM_ARM64\" -eq 1 ]; then\n        TARGETS+=(\"aarch64-apple-ios-sim\")\n      else\n        echo \"[Rust] ERROR: rustc does not support aarch64-apple-ios-sim.\" >&2\n        echo \"[Rust] Use an x86_64 simulator (run Xcode under Rosetta or set ARCHS=x86_64),\" >&2\n        echo \"[Rust] or install a toolchain that supports this target.\" >&2\n        exit 1\n      fi\n      ;;\n    iphonesimulator:x86_64)\n      TARGETS+=(\"x86_64-apple-ios\")\n      ;;\n    *)\n      echo \"[Rust] ERROR: Unsupported platform/arch: ${PLATFORM}/${ARCH}\" >&2\n      exit 1\n      ;;\n  esac\ndone\n\n# --- Build the Rust static library -----------------------------------------\nWORKSPACE_ROOT=\"$RUST_CRATE_DIR/../..\"\ncd \"$WORKSPACE_ROOT\"\n\nfor TARGET in \"${TARGETS[@]}\"; do\n  echo \"[Rust] Building nesium-flutter ($BUILD_LABEL) for $TARGET (CONFIGURATION=${CONFIGURATION:-<unset>}, PLATFORM=${PLATFORM})\"\n  cargo build --target \"$TARGET\" \"${CARGO_ARGS[@]}\" -p nesium-flutter\ndone\n\nmkdir -p \"$FRAMEWORKS_DIR\"\nDST_LIB=\"$FRAMEWORKS_DIR/$OUTPUT_LIB_NAME\"\n\nLIBS=()\nfor TARGET in \"${TARGETS[@]}\"; do\n  LIB=\"target/$TARGET/$PROFILE_DIR/$OUTPUT_LIB_NAME\"\n  if [ ! -f \"$LIB\" ]; then\n    echo \"[Rust] ERROR: Built library not found: $LIB\" >&2\n    echo \"[Rust] Available files in target/$TARGET/$PROFILE_DIR:\" >&2\n    ls \"target/$TARGET/$PROFILE_DIR\" >&2 || true\n    exit 1\n  fi\n  LIBS+=(\"$LIB\")\ndone\n\nif [ \"${#LIBS[@]}\" -gt 1 ]; then\n  echo \"[Rust] Creating universal static library: $DST_LIB\"\n  lipo -create \"${LIBS[@]}\" -output \"$DST_LIB\"\nelse\n  cp \"${LIBS[0]}\" \"$DST_LIB\"\n  echo \"[Rust] Copied ${LIBS[0]} -> $DST_LIB\"\nfi\n";
